vational Interviewing','MI',763326334047675,NULL,'776300774492735','www.accessmha.com',NULL,'Not vetted','1240410422818771,1203772244712309,927196575193538,1009514155552809,1174330362614495,554388805123029,973043712374470,884876263410314,770867467503452,953269632165882,1309246678478896,9877520705',NULL,NULL,NULL,NULL,NULL,'637911491907869',NULL,'1145634854238262','639387097779678,791587286497701,1297919866260619,789421862693567,771052077935881,968949207637259,616815450655447,1213394553614190,1242514362876733',NULL,'3/6/2019 15:27:59',NULL),(50,662049722606958,'PTSD',NULL,1339182713147731,'TF-CBT is a structured, short-term treatment model for improving childrens trauma symptoms and responses.  It effectively improves a range of trauma-related outcomes in 8 to 25 sessions with the child/adolescent and parent/caregiver.  Although TF-CBT is highly effective at improving youth posttraumatic stress disorder (PTSD) symptoms and diagnosis, a PTSD diagnosis is not required in order to receive this treatment.  TF-CBT also effectively addresses many other trauma impacts, including affective (e.g., depressive, anxiety), cognitive and behavioral problems, as well as improving the participating parents/caregivers personal distress about the childs traumatic experience, effective parenting skills and supportive interactions with the child.','680724149779279','https://www.psychologytoday.com/us/therapists/trauma-drama-therapy-savannah-ga/154733','lrumpel@traumadrama.us','Vetting In Progress','1003468187388912,751209368821784,790497382892263,1039361098841116',NULL,NULL,NULL,NULL,NULL,'1225987825999811',NULL,'588559626701281','639387097779678,1297919866260619,789421862693567,771052077935881,988970636517896,675333962875133,915499537874128,944379166032449,818831669488442,616815450655447,953369181551142,1213394553614190',NULL,'3/20/2019 13:48:05',NULL),(51,639080353826117,'PTSD',NULL,1306784019365289,NULL,'766114163250573','http://www.georgiaoutreach.com/therapists-3/judy-saucerman-lcs